import React from 'react'

export default function Die(props) {
  const styles = {
    backgroundColor: props.isHeld ? "#59E391": "white"
  }

  console.log(props.isHeld)
  return (
    <div
      className="die"
      style={styles}
      onClick={() => props.eventHandle(props.id) }>

      <h2 className="die-num">{props.value}</h2>
    </div>
  )
}
